import logo from './logo.svg';

import {Routes, Route} from 'react-router-dom';

import Loading from './Loading';
import Home from './Home';

import './App.css';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route exact path='/' render={() => <Home/>}/>
        <Route path='/loading' render={() => <Loading/>}/>
      </Routes>
    </div>
  );
}

export default App;
